INSERT INTO `t_td_colitem` VALUES ('60067', '67', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.zhcx.impl', 'com.ygsoft.grm.budget.service', '预算多维编制项目组', '', 'qfw_plus6.0@qfw@com.ygsoft.grm.zhcx.impl', '张世永', '', '修改为消费远程服务', null, null, null, null, null, 'ygfmis.bc.commonquery.budgetadjust.BudgetAdustUtils.getDepartment(dwdh,\"\")', 'ygfmis.bc.commonquery.guowang.ystzhistory.YstzQryEngine.filterOtherDept(String, FmisDataSet)', ' private FmisDataSet filterOtherDept(final String dwdh, final FmisDataSet result) {\n  //取得当前登陆用户所在部门\n  BudgetAdustUtils utils = new BudgetAdustUtils();\n  \n  String deptInfo = utils.getDepartment(dwdh,\"\"\"\");\n\n  if (! \"\"\"\".equals(deptInfo)) {  \n   String deptID = deptInfo.split(\"\",\"\")[1];\n   result.first();\n   while(!result.isEof()) {\n    if (!result.getColumn(\"\"DEPT\"\").getAsString().equals(deptID)) {\n     result.delete();\n    } else {\n     result.next();\n    }\n   }\n  }\n  return result;\n }', ' private FmisDataSet filterOtherDept(final String dwdh, final FmisDataSet result) {\n  //取得当前登陆用户所在部门\n//  BudgetAdustUtils utils = new BudgetAdustUtils();\n//  \n//  String deptInfo = utils.getDepartment(dwdh,\"\"\"\");\n  final String className = \"\"\"\";\n  final String methodName = \"\"\"\";\n  final String classAndMethodName=className+\"\".\"\"+methodName;\n  final Object []parameters ={dwdh,\"\"\"\"};\n  String deptInfo=\"\"\"\";\n  try {\n   deptInfo = MappServiceUtil.doGet(classAndMethodName, parameters);\n  } catch (IOException e) {\n   throw new FmisRuntimeException(e);\n  }\n  if (! \"\"\"\".equals(deptInfo)) {  \n   String deptID = deptInfo.split(\"\",\"\")[1];\n   result.first();\n   while(!result.isEof()) {\n    if (!result.getColumn(\"\"DEPT\"\").getAsString().equals(deptID)) {\n     result.delete();\n    } else {\n     result.next();\n    }\n   }\n  }\n  return result;\n }', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
INSERT INTO `t_td_colitem` VALUES ('60068', '68', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.zhcx.impl', 'com.ygsoft.grm.budget.service', '预算多维编制项目组', '', 'qfw_plus6.0@qfw@com.ygsoft.grm.zhcx.impl', '张世永', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.fmis.ys.blf.BlfGkYsService.getYsdyDataToS02', 'com.ygfmis.query.commonquery.yscx.business.BudgetManager.getYSKMFilterData()', 'public final String getYSKMFilterData() throws Exception {\n  final BlfGkYsService bys = new BlfGkYsService();\n  return bys.getYsdyDataToS02();  \n }', '\n private FmisDataSet filterOtherDept(final String dwdh, final FmisDataSet result) {\n  //取得当前登陆用户所在部门\n//  BudgetAdustUtils utils = new BudgetAdustUtils();\n//  \n//  String deptInfo = utils.getDepartment(dwdh,\"\"\"\");\n  //modify by zhangshiyong 2019-08-16  解决基础包依赖服务业务服务包问题。需要业务项目组提供服务实现\n  final String className = \"\"\"\";\n  final String methodName = \"\"getDepartment\"\";\n  final String classAndMethodName=className+\"\".\"\"+methodName;\n  final Object []parameters ={dwdh,\"\"\"\"};\n  String deptInfo=\"\"\"\";\n  try {\n   deptInfo = MappServiceUtil.doGet(classAndMethodName, parameters);\n  } catch (IOException e) {\n   throw new FmisRuntimeException(e);\n  }\n  if (! \"\"\"\".equals(deptInfo)) {  \n   String deptID = deptInfo.split(\"\",\"\")[1];\n   result.first();\n   while(!result.isEof()) {\n    if (!result.getColumn(\"\"DEPT\"\").getAsString().equals(deptID)) {\n     result.delete();\n    } else {\n     result.next();\n    }\n   }\n  }\n  return result;\n }', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
INSERT INTO `t_td_colitem` VALUES ('60069', '69', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.zhcx.impl', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'qfw_plus6.0@qfw@com.ygsoft.grm.zhcx.impl', '张世永', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.bl.IZjjzzfBL.getFormatId(ywid + \"\"\"\");\ncom.ygsoft.grm.payment.service.bl.IZjjzzfBL.getMXInfo(typeId, dbfName, gid)', 'com.ygfmis.query.djsjzt.bl.DjsjztQueryUtils.getZjjzzfBusinessService(int, String, int, String)', ' public String getZjjzzfBusinessService(final int ywid, final String dbfName, final int gid, final String typeId)\n   throws Exception {\n  // 子表项目序号，如HZZB\n  final String zbXmxh = dbfName.substring(dbfName.indexOf(\"\"YWBILL\"\") + ZDFNMAE_LENGTH);\n  final IZjjzzfBL zjjjzfBL = (IZjjzzfBL) BusinessLogicFactory.createInTransaction(ZJJZZF_BL_NAME);\n  final String formatId = zjjjzfBL.getFormatId(ywid + \"\"\"\");\n  // xmInfo[0]:BILLID1,xmInfo[1]:BILLID 2\n  final String[] xmInfo = zjjjzfBL.getMXInfo(typeId, dbfName, gid);\n  final int billId1 = Integer.parseInt(xmInfo[0]);\n  final int billId2 = Integer.parseInt(xmInfo[1]);\n  final DpbjServices dpbjServices = new DpbjServices();\n  String url = dpbjServices.getDpbjUrlByTableRowYWId(ywid, billId1, billId2, zbXmxh, formatId);\n  url = url.substring(0, url.indexOf(\"\",\"\"));\n  return url;\n }', '\n public String getZjjzzfBusinessService(final int ywid, final String dbfName, final int gid, final String typeId)\n   throws Exception {\n  // 子表项目序号，如HZZB\n  final String zbXmxh = dbfName.substring(dbfName.indexOf(\"\"YWBILL\"\") + ZDFNMAE_LENGTH);\n  \n  //modify by zhangshiyong 2019-08-16  解决基础包依赖服务业务服务包问题。需要业务项目组提供服务实现\n  final String className = \"\"\"\";\n  try {\n   String methodName = \"\"getFormatId\"\";\n   String classAndMethodName=className+\"\".\"\"+methodName;\n   final Object []parameters ={ywid + \"\"\"\"};\n   String formatId = MappServiceUtil.doGet(classAndMethodName, parameters);\n   \n   methodName = \"\"getFormatId\"\";\n   classAndMethodName=className+\"\".\"\"+methodName;\n   final String xmInfoStr = MappServiceUtil.doGet(classAndMethodName, parameters);\n   final String[] xmInfo = JSONUtil.fromJsonString(xmInfoStr, String[].class);\n   final int billId1 = Integer.parseInt(xmInfo[0]);\n   final int billId2 = Integer.parseInt(xmInfo[1]);\n   final DpbjServices dpbjServices = new DpbjServices();\n   String url = dpbjServices.getDpbjUrlByTableRowYWId(ywid, billId1, billId2, zbXmxh, formatId);\n   url = url.substring(0, url.indexOf(\"\",\"\"));\n   return url;\n  } catch (IOException e) {\n   throw new FmisRuntimeException(e);\n  }\n  \n//  final IZjjzzfBL zjjjzfBL = (IZjjzzfBL) BusinessLogicFactory.createInTransaction(ZJJZZF_BL_NAME);\n//  final String formatId = zjjjzfBL.getFormatId(ywid + \"\"\"\");\n  // xmInfo[0]:BILLID1,xmInfo[1]:BILLID 2\n//  final String[] xmInfo = zjjjzfBL.getMXInfo(typeId, dbfName, gid);\n//  final int billId1 = Integer.parseInt(xmInfo[0]);\n//  final int billId2 = Integer.parseInt(xmInfo[1]);\n//  final DpbjServices dpbjServices = new DpbjServices();\n//  String url = dpbjServices.getDpbjUrlByTableRowYWId(ywid, billId1, billId2, zbXmxh, formatId);\n//  url = url.substring(0, url.indexOf(\"\",\"\"));\n//  return url;\n }', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
