INSERT INTO `t_td_colitem` VALUES ('60178', '178', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.ygfmisbcinput', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'gris6.0_plus6.0@gris.ywsj@YGFMISBCInput', '蒋健峰', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.bl.IOrignMessageBL.updateYqhllogByZfzt();\n\ncom.ygsoft.grm.payment.service.bl.IOrignMessageBL.updateYghllogAfterSplitBill();\n\ncom.ygsoft.grm.payment.service.bl.IOrignMessageBL.updateAfterCancellBill();\n\ncom.ygsoft.grm.payment.service.bl.IOrignMessageBL.updateYghllogAfterSplitBill();', 'ygfmis.bc.input.centralize.event.AfterBillSplitEvent.updateYghllogInfo(List)', 'orignMessageBL.updateYqhllogByZfzt(billParams.getSplitTabName(), billParams.getYwid(), billParams\n							.getSplitMap());\n					// append new code end <br>\n			    	/**\n					 * MODIFY W4898 @author lihy <br>\n					 * modify code 2011-1-17 上午09:51:52 <br>\n					 * 不在拆单后作废YHQLLOG表的记录，而是在下次传递前作废 <br>\n					 * Mod Code @author luzt on 2011-2-11.<br>\n					 * For 回退时也要把YQHLLOG的GID、BILLID等信息更正\n					 */\n			    	if (billParams.isNewBill()) {\n				        orignMessageBL.updateYghllogAfterSplitBill(billParams.getNewYwid(), billParams.getYwid(),\n                            billParams.getTypeId(), billParams.getSplitTabName(), billParams.getSplitMap());\n				        /**\n						 * APPEND 81456  @author heminzhi <br>\n						 * add new code 2012-10-31 上午12:01:38 <br> \n						 * 资金应付安排单据拆时,在T_ZJ_ZFXX_YFAP表中把旧的YWID,MXID更新成新的YWID,MXID <br>\n						 */\n						applyBl.traceYfZfxxYwidMxidEvent(billParams.getYwid(), billParams.getNewYwid(), billParams\n								.getSplitMap());\n						//append new code end <br>\n						/**\n						 * add for 343629\n						 * 支付融合发起支付申请后，拆单时T_ZJ_ZFPLANRELATION表中把旧的YWID,MXID更新成新的YWID,MXID.\n						 */\n						applyBl.traceZfPlanYwidMxidEvent(billParams.getYwid(), billParams.getNewYwid(), billParams\n								.getSplitMap());\n				    }\n			        //回退处理\n			        //orignMessageBL.updateYqhllogStop(billParams.getActivityID(), \n			        //		billParams.getSplitTabName(), billParams.getSplitMap());\n			    } else if (billParams.getOperationType() == CentralizeBillConst.OPER_TYPE_CANCLE) {\n			    	//作废处理\n			    	orignMessageBL.updateAfterCancellBill(billParams.getNewYwid(), billParams.getYwid(),\n                            billParams.getTypeId(), billParams.getSplitTabName(), billParams.getSplitMap());\n\n					/**\n			    	 * mod 154938 hemz 2012-11-18 作废增加应付安排数据处理-删除应付安排数据.\n			    	 */\n			    	applyBl.operateYfapDsByDjInfo(billParams.getYwid(), billParams.getNewYwid(), billParams\n							.getSplitMap());\n			    	//428055\n					zjzfIntegrationBL.sendCanceledYWBillInfoToSAP(billParams.getTypeId(), billParams.getNewYwid(),\n							billParams.getSplitMap());\n			    } else {\n			    	//传递\n				    if (billParams.isNewBill()) {\n				        orignMessageBL.updateYghllogAfterSplitBill(billParams.getNewYwid(), billParams.getYwid(),\n                            billParams.getTypeId(), billParams.getSplitTabName(), billParams.getSplitMap());\n				        /**\n						 * APPEND 81456  @author heminzhi <br>\n						 * add new code 2012-10-31 上午12:01:38 <br> \n						 * 资金应付安排单据拆时,在T_ZJ_ZFXX_YFAP表中把旧的YWID,MXID更新成新的YWID,MXID <br>\n						 */\n						applyBl.traceYfZfxxYwidMxidEvent(billParams.getYwid(), billParams.getNewYwid(), billParams\n								.getSplitMap());\n						//append new code end <br>\n				    }', '', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
