INSERT INTO `t_td_colitem` VALUES ('60189', '189', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.ygfmisbcinput', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'gris6.0_plus6.0@gris.ywsj@YGFMISBCInput', '蒋健峰', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.util.JzzfUtils.setTextValue()\n\ncom.ygsoft.grm.payment.service.util.JzzfUtils.setMoneyTypeText()', 'ygfmis.bc.input.centralize.CentralizeBillBL.processTransIDMC(FmisDataSet)\n\nygfmis.bc.input.centralize.CentralizeBillBL.processCurcodeTextValue(FmisDataSet)\n\nygfmis.bc.input.centralize.CentralizeBillBL.processIsTextValue(FmisDataSet)', 'if (IS_TEXT_COLUMNS.indexOf(CentralizeBillConst.COMMA + bo.getXmname() + CentralizeBillConst.COMMA) != -1) {\n						utils.setTextValue(subBillData, bo.getXmxh(), IS_ENUM_VALUES);\n					} else if (CURCODE.equals(bo.getXmname())) {\n						utils.setMoneyTypeText(subBillData, bo.getXmxh());\n					}\n\nfinal JzzfUtils utils = new JzzfUtils();\nutils.setMoneyTypeText(jzspDs, jzspCurcodeXmxhs[i]);\n					jzspDs.getColumn(jzspCurcodeXmxhs[i]).setWidth(150);\n\nfinal JzzfUtils utils = new JzzfUtils();\n		final String[] jzspIsXmxhs = getXtywbillDAO().getJzspIsXmxhs(this.typeid);\n		for (int i = 0; i < jzspIsXmxhs.length; i++) {\n			if (jzspDs.getColumn(jzspIsXmxhs[i]) != null \n					&& (\"\"1\"\").equals(jzspDs.getColumn(jzspIsXmxhs[i]).getAsString().trim())) {\n				utils.setTextValue(jzspDs, jzspIsXmxhs[i], \"\"0:否;1:是\"\");\n			} else if (jzspDs.getColumn(jzspIsXmxhs[i]) != null ) {\n				utils.setTextValue(jzspDs, jzspIsXmxhs[i], \"\"0:否;1:是\"\");\n			}\n		}', '', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
INSERT INTO `t_td_colitem` VALUES ('60190', '190', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.ygfmisbcinput', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'gris6.0_plus6.0@gris.ywsj@YGFMISBCInput', '蒋健峰', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.util.ZjzfCommonUtil.isFullDjZfMode()\n\ncom.ygsoft.grm.payment.service.util.ZjzfCommonUtil.isDjFinished()\n\ncom.ygsoft.grm.payment.service.util.ZjzfCommonUtil.isDjNoPay()', 'ygfmis.bc.input.common.BillConfig.isZJZFDJ(String, String, String)', 'if (ZjzfCommonUtil.isFullDjZfMode()) {\n			/**\n			 * MODIFY W5839 @author luwei <br>\n			 * modify code 2011-11-14 上午10:00:06 <br>\n			 * 允许资金支付的单据作废，仅青海 <br>\n			 */\n			if (isZJZF) {\n				// 如果是\n				if (ZjzfCommonUtil.isDjFinished(billid, dwdh, year) || ZjzfCommonUtil.isDjNoPay(billid, dwdh, year)) {', '', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
INSERT INTO `t_td_colitem` VALUES ('60191', '191', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.ygfmisbcinput', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'gris6.0_plus6.0@gris.ywsj@YGFMISBCInput', '蒋健峰', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.model.TypeIdYqDjxmMap.get()', 'ygfmis.centralize.bill.action.CentralizeArticulationAction.checkAccnoAndYlhCoree(String, Map)', '// 银企对应单据项目的map集合\n		final TypeIdYqDjxmMap djxmMap = new TypeIdYqDjxmMap();\n		// 根据单据类型获取相应单据类型的单据项目集合\n		final YqDjxmOfTypeIdBO djxmBo = djxmMap.get(typeId);', '', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
INSERT INTO `t_td_colitem` VALUES ('60192', '192', '6', '否', 'GAP依赖业务包', 'com.ygsoft.grm.ygfmisbcinput', 'com.ygsoft.grm.payment.service', '支付结算项目组', '', 'gris6.0_plus6.0@gris.ywsj@YGFMISBCInput', '蒋健峰', '', '修改为消费远程服务', null, null, null, null, null, 'com.ygsoft.grm.payment.service.model.bo.YqDjxmOfTypeIdBO.getYqxmToDjxmBoList()', 'ygfmis.centralize.bill.action.CentralizeArticulationAction.checkAccnoAndYlhCoree(String, Map)', '// 根据单据类型获取相应单据类型的单据项目集合\n		final YqDjxmOfTypeIdBO djxmBo = djxmMap.get(typeId);\n		// 获得单据项目list\n		final List djxmList = djxmBo.getYqxmToDjxmBoList().getList();', '', null, '0', '0', '0', '0', '0', null, null, null, null, null, null, null, null, null, null, '0', '0');
